import React from 'react';
import './Landing.css';

function Landing() {

    return (
        <div className='body'>
            <Banner />
        </div>
    )
}

function Banner() {
    return (
        <div className='title-banner'>
            <img src='./src/img/EBA_title_img.jpeg' alt='Emma B. Andrews title'/>
            <h1>Travelers In Egypt</h1>
        </div>
    )
}



export default Landing;
